import { Box, Grid, GridItem, Text } from "@chakra-ui/layout";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <Box>
      <Grid templateColumns="2fr 1fr 1fr 1fr 1fr 1fr 2fr" padding="20px">
        <GridItem></GridItem>
        <GridItem>
          <Text as="Link" to="/">
            Home
          </Text>
        </GridItem>
        <GridItem>
          <Text>About</Text>
        </GridItem>
        <GridItem>
          <Text>IMG</Text>
        </GridItem>
        <GridItem>
          <Text>Services</Text>
        </GridItem>
        <GridItem>
          <Text>Contact</Text>
        </GridItem>
        <GridItem></GridItem>
      </Grid>
    </Box>
  );
};

export default Navbar;
